import React from 'react'
import '../styles/Cards.css';

const Cards = ({ name, id, email }) => {
    return (
        <div className="cards-wrapper">
            <img src={`https://robohash.org/${id}`} alt="robots"/>
            <h3>{name}</h3>
            <h4>{email}</h4>
        </div>
    )
}

export default Cards;
